column13:
A system for individual stack control for a flowing electrolyte battery, the system comprising: 
a flowing electrolyte battery including at least a first battery cell stack (104) and a second battery cell stack interconnected with each other and sharing a common flowing electrolyte; 
a first stack controller (200) configured and arranged to individually control a charging condition of the first battery cell stack (104) based at least in part on information regarding an operating condition of the first battery cell stack; and 
a second stack controller, separate from the first stack controller, configured and arranged to individually control a charging condition of the second battery cell stack based at least in part on information regarding an operating condition of the second battery cell stack; 
wherein the first and second stack controllers are capable of simultaneously controlling the respective charging conditions of the first and second battery cell stacks (104) differently from one another within the same flowing electrolyte battery.
